  background: #e4e4e4;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const NavLink = styled.a`
  // color: ${({ theme }) => theme.text}
  color: black;
  margin: 10px;
  font-size: 12px;
  text-decoration: none;
  :hover {
    cursor: pointer;
  }
`;

const Copyright = styled.div`
  display: flex;
  justify-content: center;
  font-size: 0.8em;
  background: #e4e4e4;
`;

<NavLink to="/about">About</NavLink>;

const Contacts = () => {
  return (
    <>
